import logo from './logo.svg';
import './App.css';
import MyButton from './Components/Boton/Button';
import Navbar from './Components/Navbar/Navbar';
import { HashRouter as Router, Routes, Route } from 'react-router-dom';
import { Enlace1 } from './Pages/Enlace1';
import { Enlace2 } from './Pages/Enlace2';

function MyOtherButton() {
  return (
    <button className='AppCssButton'>Segundo botón</button>
  );
}

function App() {
  return (
  <>
    <Router>
      <Routes>
          <Route path="/Enlace_1" element={Enlace1}/>
          <Route path="/Enlace_2" element={Enlace2}/>
      </Routes>
    </Router>
    <Navbar/>
    <h2>Boton importado de la carpeta Components.</h2>
    <MyButton/>
    <h2>Botón creado desde App.js</h2>
    <MyOtherButton />
  </>
);
}

export default App;
